import React, { Component } from 'react';
import { Parallax } from 'react-parallax';
import Collectionitem from 'components/Collectionitem.jsx'
import {Link} from 'react-router-dom';


class CoursesContent extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="CoursesContent">
          <Parallax blur={{ min: -15, max: 15 }} bgImage={require('images/download.jpg')} bgImageAlt="the dog" strength={-200}>
         <h1> {this.props.location.state.userId}</h1>
         <h2> {this.props.location.state.title}</h2>
            <div style={{ height: '200px' }} />
            
        </Parallax>
        <div className="container">
      <div>     
           {
             this.props.location.state.product.map((value,id) => {
                        return (
                                <Collectionitem key={id} showButton="true" data={value}/>
                        )
                    })
                }
            </div>
            </div>
       
      </div>
    );
  }
}

export default CoursesContent;
